import React, { useState } from 'react';
import { StyleSheet, View, Text, TouchableOpacity, FlatList,Button } from 'react-native';


export default function Pending({ navigation }) {
  const pressHandler = () => {
    //navigation.navigate('Bill');
    navigation.push('OrderDetails');
  }
  const [reviews, setReviews] = useState([
    { title: 'Zelda, Breath of Fresh Air', rating: 5, body: 'lorem ipsum', key: '1' },
    { title: 'Gotta Catch Them All (again)', rating: 4, body: 'lorem ipsum', key: '2' },
    { title: 'Not So "Final" Fantasy', rating: 3, body: 'lorem ipsum', key: '3' },
  ]);
  return (
  
    
    <View> 
    <Text> Pending screen </Text>
     <Button title='order details' onPress={pressHandler} />
     <FlatList data={reviews} renderItem={({ item }) => (
        // <TouchableOpacity onPress={() => navigation.navigate('ReviewDetails', item)}>
          <Text >{ item.title }</Text>
        // </TouchableOpacity>
      )} />
 </View>
  );
}
